Wicked Tuna Series 1

Nature Documentary hosted by Mick Rowe, published by National Geographic in 2012 - English narration


Information
------------------------------

Wicked Tuna Season 1 
Fishing is a hard life, and harder with bluefin stocks depleted. In Gloucester, Massachusetts, there's a special breed of fishermen. For generations they've used rod and reel to catch the elusive bluefin tuna. They depend on these fish for their livelihood, and the competition is brutal.
Over the next 10 weeks, the most skilled fishermen will set out in the frigid waters of the North Atlantic in hopes of catching the valuable bluefin tuna. When one bluefin can bring in as much as $20,000-they'll do whatever it takes to hook up.



4)  Size Matters 
An 1100-pound fish is reeled in by the crew of the Christina, prompting a competitive Dave to put Tuna.com into overdrive to catch up. Meanwhile, Marciano takes out a charter tour in an effort to pay off his accumulating debt. Newcomer Kevin snags a 500kg &quot;monstah&quot; right out of the gate. The biggest catch of the season, it's the talk of the town. But other boats are doing it tough in a tight economy with no help in sight.


